APP.factory("TPL",[function(){return{footerWs:'\n<div id="footer" ng-init="addr=\'163 Legionow Gdyna Poland\'">\n    <div id="panel">\n      <input id="address" type="textbox" ng-model="addr">\n      <input type="button" value="Locate on Map" ng-click="locAddress()">\n    </div>\n    <div ng-show="coords.lon">Lon: {{coords.lon}}, Lat: {{coords.lat}}</div>\n    <div ng-show="coords.elevation" >Elevation {{coords.elevation}}</div>\n</div>\n',leftWs:'\n<div id="left">left pane</div>\n',mapWs:'\n<div id="content"></div>\n',menuWs:'\n<div id="contentMenu">\n    <button ng-click="activate(\'box\');" ng-class="box|checkActive">Box</button>\n    <button ng-click="activate(\'point\');" ng-class="point|checkActive">Point</button>\n    <button ng-click="activate(\'center\');" ng-class="center|checkActive">Center</button>\n    <button ng-click="activate(\'elevation\');" ng-class="elevation|checkActive">Elevation</button>\n</div>\n',rightWs:'\n<div id="right">right pane</div>\n',whitespace:'\n<div id="container">\n    <div left-ws></div><div menu-ws></div><div map-ws></div><div right-ws></div>\n    <div footer-ws></div>\n</div>\n'}}]);